import React, { useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import { useCooperation } from '../../navigation/CooperationContext';
import axios from 'axios';

const CooperationTemplate = () => {
    const location = useLocation();
    const { setCurrentCooperation } = useCooperation();
    
    useEffect(() => {
        const fetchCooperation = async () => {
            try {
                const { id } = location.state.building; // Вземете ID-то от state
                const response = await axios.get(`http://localhost:8080/cooperation/${id}`);
                setCurrentCooperation(response.data); // Задайте текущата кооперация
            } catch (error) {
                console.error('Error fetching cooperation:', error);
            }
        };

        fetchCooperation();
    }, [location.state.building, setCurrentCooperation]);

    return (
        <div>
            <h1>Cooperation: {location.state.building.title}</h1>
            {/* Добавете останалата част от компонента */}
        </div>
    );
};

export default CooperationTemplate;
